import {
  React,
  theme,
  calendarStyles,
  moment,
  ThemeProvider,
  Button,
} from "./index.js";

const DayButton = (day) => {
  const classes = calendarStyles();

  return (
    <ThemeProvider theme={theme}>
      {console.log(moment(day).format("D"))}
      <Button className={classes.dayButton}>{moment(day).format("D")}</Button>
    </ThemeProvider>
  );
};

export default DayButton;
